import React, { Component } from "react";
import { Link } from "react-router-dom";

export class Header extends Component {
  render() {
    return (
      <div className="header">
        <h1>TodoList</h1>
        <Link className="link" to="/">
          Home
        </Link>
        |
        <Link className="link" to="/about">
          About
        </Link>
      </div>
    );
  }
}

export default Header;
